🔧TVP wywiązała się z prawnego obowiązku zapewnienia bezpłatnego czasu antenowego, z którego skorzystali wszyscy kandydaci z wyjątkiem pana Jakubiaka.Zgodnie z wymogami prawa TVP przeprowadziła 12 maja debatę z udziałem wszystkich kandydatów. Debata została zrealizowana we współpracy z TVN i Polsatem, których dziennikarze pełnili rolę współprowadzących.
🔧 11 kwietnia sztab wyborczy pana Trzaskowskiego zorganizował dyskusję w formie debaty, którą poprowadziły i transmitowały TVP, TVN i Polsat. Początkowo zaproszono tylko pana Nawrockiego, ale po jego odmowie zaproszenie rozszerzono na wszystkich kandydatów. Udział wybranych nadawców prywatnych w organizacji debaty wraz z TVP, w połączeniu z wykluczeniem innych mediów oraz prowadzenie przez TVP przygotowań wydarzenia wyborczego zorganizowanego przez jednego z kandydatów wzbudziło obawy niektórych zainteresowanych stron, między innymi przewodniczącego KRRiT. Kilka debat zostało również zorganizowanych przez nadawców prywatnych, chociaż tylko w jednej z nich udział wzięli wszyscy kandydaci.

🔧Wyniki monitoringu mediów, przeprowadzonego przez misję ODHIR LEOM, wykazały wyraźną polaryzację mediów.  Wszystkie monitorowane media, z wyjątkiem TV Republika, poświęciły największą część relacji Nawrockiemu, od 31% do 37% wszystkich wiadomości o kandydatach, przy czym ton był zróżnicowany: od przeważnie neutralnego w Interii i Polsacie do negatywnego i neutralnego w publicznych TVP1, TVP-Info i prywatnych, TVN i Onet. Pan Trzaskowski otrzymał od 18% do 20% relacji, które były głównie neutralne w TVP-Info, Interii, Onet, TVN i Polsacie oraz neutralne i mniejszym stopniu pozytywne w TVP1 i Pan Hołownia otrzymał między 10% a 14% relacji o głównie pozytywnym i neutralnym zabarwieniu w TVP-Info, oraz głównie neutralnym zabarwieniu w Polsacie, Interii, Onecie, TVN i TVP1. W przeciwieństwie do tego TV Republika poświęciła Trzaskowskiemu około 42% relacji, prawie całkowicie negatywnych w tonie, 34% Nawrockiemu, głownie w tonie pozytywnym i 6% Hołowni, głównie w tonie negatywnym i neutralnym Monitorowane media poświęciły znaczną ilość głównie neutralnych relacji Biejat (od 5% do 11%), Zandbergowi (od 4% do 6%) oraz neutralnym i negatywnych relacji Mentzenowi (od 5% do 9%). TV Republika poświęciła 4% relacji Zandbergowi, 3% Biejat i 2% Mentzenowi, w tonie głównie neutralnym lub negatywnym. Braun otrzymał od 4% do 5% głównie negatywnych relacji we wszystkich mediach z wyjątkiem TV Republika, która poświęciła mu tylko 1 procent relacji, w tonie neutralnym.

